  input: TEXT,F3XA,,"In response to your letter, please note that the Committee has
    followed the Commission guidelines for obtaining full name, mailing address, occupation
    and employer of each donor.  The original solicitation contained a clear request
    for the information.  Any donor who did not provide the information was contacted
    within 30 days.  Many received a phone call and those calls have been documented.  Others
    received a letter explaining the law and requesting that they return the letter
    with the requested information in the pre-addressed, pre-stamped envelope.  Any
    donors who provided the information have been reported.  You have requested that
    we provide information regarding administrative expenses.  The Committee is very
    small and does not require an office.  Expenses have been reimbursed in subsequent
    reports to individuals and consultants.  Additionally, the Treasurer is paid for
    all compliance and accounting fees.  If you have any questions or concerns please
    contact me at 202/479-7042."
